            sh:class ?zoneClass .
    ?zoneClass rdfs:subClassOf* brick:Zone .
  }

  # External reference with the required endpoints (alc or mpc)
  ?property brick:hasExternalReference ?extRef .
  ?extRef brick:endpoint ?endpoint .
  FILTER(?endpoint = "alc" || ?endpoint = "mpc")
}
ORDER BY ?property

